import React from "react";

class Section2 extends React.Component{
    render(){
        return(
            <section className="Section2-info">
                <div className="graduates Section2-block">
                    <span className="fa-regular fa-clock icon"><span className="Section2-info-project">1900+</span></span>
                    <span className="Section2-description">Обучили учеников и успешно сдали экзамен</span>
                </div>

                <div className="graduates Section2-block">
                <i class="fa-light fa-user-graduate"></i>

                </div>
                <div className="graduates Section2-block">
                <i class="fa-regular fa-star"></i>

                </div>
            </section>
        )
    }
}
export default Section2;
